        let a = [];
        if (json.quotes !== null && json.quotes !== undefined) {
          const objectArray = Object.entries(json.quotes);
          objectArray.forEach(([key, value]) => {
            a.push({ symbol: key, rate: value, price: value });

            // console.log(a, "fx");
